import React from "react";
import Common from "./Common";

const About = () => {
  return (
    <>
      <Common
        name="Welcome to About page"
        visit="/contact"
        imgsrc="data:image/jpeg;base64,"
        btname="Contact Now"
      />
    </>
  );
};

export default About;
